int
sn_send_log_for_event(const sn_notif * notif,
                      const bn_request * event_req,
                      const bn_binding_array * bindings,
                      void *data, sn_custom_notif_response * ret_resp)
{
    int         err = 0;
    node_name_t node_name = {0};
    bn_binding *binding = NULL;
    tstring *disk_name = NULL;
    tstring *value = NULL;
    const char *snmp_bn_name = NULL;
    node_name_t name = {0}, bn_name = {0};

    lc_log_basic(LOG_NOTICE, "Trap (%s) is raised ",
                 notif->sno_notif_name);

    for ( uint16 i = 0; i < notif->sno_num_vars ; i++) {
	switch (notif->sno_vars[i].snv_type) {
	case snvt_scalar_reg:
	    snmp_bn_name = notif->sno_vars[i].snv_scalar->ss_snmp_var_name;
	    bail_null(snmp_bn_name);
	    snprintf(bn_name, sizeof(bn_name),"%s", notif->sno_vars[i].snv_scalar->ss_mgmt_node_name);
	    break;
	case snvt_field_reg:
	    snmp_bn_name = notif->sno_vars[i].snv_field->sf_snmp_field_name;
	    snprintf(bn_name, sizeof(bn_name),"%s", notif->sno_vars[i].snv_field->sf_table->st_mgmt_root_pattern);
	    bail_null(snmp_bn_name);
	    if ( notif->sno_vars[i].snv_field->sf_source == sfs_child_value){
		snprintf(name, sizeof(name), "/%s", notif->sno_vars[i].snv_field->sf_mgmt_node_child_name);
		strlcat(bn_name, name, sizeof(bn_name));
	    }
	    break;
	}	
	err = bn_binding_array_get_first_matching_value_tstr(bindings, bn_name, 0, NULL, NULL, &value);
        bail_error_null(err, value);

	lc_log_basic(LOG_NOTICE, "Variable Binding[%d]: %s( %s )", i, snmp_bn_name, ts_str(value));
	ts_free(&value);
    } 

    if (0 == strcmp(notif->sno_event_name, 
		"/nkn/nvsd/diskcache/events/disk_failure")) {
	/* add diskname binding */
	err = bn_binding_array_get_value_tstr_by_name
	    (bindings, "disk_name", NULL, &disk_name);
	bail_error(err);
        err = bn_binding_array_new(&(ret_resp->scnr_extra_bindings));
        bail_error(err);
	snprintf(node_name, sizeof(node_name), 
		"/nkn/monitor/disk/%s",ts_str(disk_name));
        err = bn_binding_new_str(&binding, node_name, 
                                 ba_value, bt_string, 0, 
                                 ts_str(disk_name));
        bail_error(err);
        err = bn_binding_array_append_takeover
            (ret_resp->scnr_extra_bindings, &binding);
        bail_error(err);
    }
bail:
    ts_free(&value);
    return (err);
}

static int
sn_mib_mfd_cpu_util_pct1min(const sn_field *field,
	const char *root_node_name, void *data,
	tstring **ret_node_name)
{
    int err = 0;
    const char *prefix = "/system/cpu/indiv/", *cpu_num_str = NULL;
    uint32 prefix_len = 0, node_name_len = 0;
    tstring *new_node_name = NULL;

    bail_null(field);
    bail_null(root_node_name);
    bail_null(ret_node_name);

    prefix_len = strlen(prefix);
    node_name_len = strlen(root_node_name);
    bail_require(node_name_len > prefix_len);
    cpu_num_str = root_node_name + prefix_len;
    /*
     *  XXX/EMT: this relies on certain statsd configuration remaining
     *  the same.
     */
    err = ts_new_sprintf(&new_node_name,
	    "/stats/state/chd/cpu_util_ave/node/"
	    "\\/system\\/cpu\\/indiv\\/%s\\/busy_pct/"
	    "last/value", cpu_num_str);
    bail_error_null(err, new_node_name);
bail:
    if (ret_node_name) {
	*ret_node_name = new_node_name;
    }
    return(err);
}

int
sn_register_table_field(sn_table *table, sn_field_details_t *fields)
{
    int err = 0, i = 0;
    sn_field *field = NULL;
    sn_field_details_t *field_detail = NULL;

    for (i = 0; /* no condition */ ; i++) {
	field_detail = fields + i;
	if (field_detail->field_name == NULL) {
	    break;
	}

	err = sn_reg_field_new(&field);
	bail_error(err);
	field->sf_snmp_field_name = field_detail->field_name;
	if (field_detail->snmp_type) {
	    field->sf_snmp_field_type = field_detail->snmp_type;
	} else {
	    field->sf_snmp_field_type = ASN_COUNTER64;
	    field->sf_flags |= svf_counter64;
	}
	field->sf_rel_oid = field_detail->oidval;
	field->sf_rel_oid_len = field_detail->oid_len;
	field->sf_index = false;
	field->sf_source = sfs_child_value;
	field->sf_mgmt_node_child_name = field_detail->mgmt_node;
	if (field_detail->mgmt_type) {
	    field->sf_mgmt_type = field_detail->mgmt_type;
	} else {
	    field->sf_mgmt_type = bt_uint64;
	}

	err = sn_reg_field_register(table, field);
	bail_error(err);
    }
bail:
    return err;

}
